/* xml_yylex_destroy is for both reentrant and non-reentrant scanners. */
int xml_yylex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		xml_yy_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		xml_yypop_buffer_state();
	}

	/* Destroy the stack itself. */
	xml_yyfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Destroy the start condition stack. */
        xml_yyfree((yy_start_stack)  );
        (yy_start_stack) = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * xml_yylex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

